      <div
        className="d-flex justify-content-center align-items-center"
        style={{ height: "25rem", margin: "auto" }}
      >
        <h3>selam</h3>
        {data?.map((item, index) => {
          <div>
            <h3>selam</h3>
            <List item={item} />
          </div>;
        })}
      </div>
    </div>
  );
}

export default App;
